import React, { Component } from 'react';
import css from './readOnlyInput.module.css';


export default class ReadOnlyInput extends Component {
    componentDidMount(){
        console.log(this.props);
    }
    componentDidUpdate(){
        console.log('Read only updated');
    }
    render() { 
        const {val, title, id} = this.props;
        const classes = id === 'liquido' ? ' className={classes}input-field col s3 orange-text darken-3' : 'input-field col s3';
        return ( 
            <div className='row'>
                <input  type="text" className={css.result} readOnly value={val }/>
                <label className="active" > {title} </label>
            </div>
         );
    }
}
